B.IH=new A.k2("TIBCO","\n      After interning with TIBCO in May 2020, I have worked as a full time Software Engineer at TIBCO since May 2021.\n\n      My work mostly focuses on providing support and enhancements for select TIBCO Messaging products.\n\n      Since then, my skills in Python, Go, Docker, teamwork, and more have increased exponentially.\n      ","May 2020 - Present",null)
B.IJ=new A.k2("Semi-Autonomous Driving Research","      \n      Working in the Mechanical, Materials, and Aerospace Engineering department, I created a 3D driving simulation in Unity3D which aims to replicate a real life driving experience in order to collect data.\n\n      Using projectors on the surrounding walls displaying my simulation, and a custom physical car frame with a digital steering wheel, users experienced a sensory experience akin to driving.\n      \n      This data was fed into custom designed algorithms aiming to assist drivers in optimizing fuel efficiency and tire wear.\n      ","October 2019 - January 2020",null)
B.IK=new A.k2("Computer Science Teaching Assistant","      \n      Taught Java to introductory CS students, including basic programming and OOP principles such as objects, arrays, loops, and more\n      \n      Also taught Data Structures and Algorithms to second year CS students, which focused on implementing and using various data structures such as Heaps, BSTrees, Linked Lists, and more.\n      ","August 2019 - May 2020",null)
B.II=new A.k2("BSCS @ the Illinois Institute of Technology","      \n      Achieved a Bachelor's of Science in Computer Science degree at the Illinois Institute of Technology, graduating early in three years.\n      \n      Took a wide range of Science and Computer Science classes. Notable coursework includes: Operating Systems, Data Structures & Algorithms, Database Organization, Software Engineering, Introduction to Algorithms, Object Oriented Programming, Multivariate & Vector Calculus, Matrices or Matrix Algebra & Complex Variables, and Probability/Statistics.\n      ","GPA-3.6/4 | August 2018 - May 2021",null)
B.IL=new A.k2("Association for Computing Machinery","      \n      Developed a KaiOS mobile application to help individuals escape poverty. This won the \u201cMost Feasible\u201d award at PayPal Hack Chicago, where $100 was donated to a charity of our choice. \n      \n      Attended HackIllinois, most notably contributed to the Anaconda project where I fixed bugs in source code.\n\n      Met lots of like-minded individuals and discovered the importance/impact that technology could have on society.\n      ","August 2018 - December 2019",null)
